import './App.css';
// import Habit from './components/habits.jsx';
import React, { useState } from 'react';

const App = props => {

  const _habits = [
    new habitGenerator('Running'),
    new habitGenerator('Eating'),
    new habitGenerator('Reading'),
  ]

  function habitGenerator(habit) {
    this.id = Date.now();
    this.habit = habit;
    this.count = 0;
  }

  const [ habits, setHabits ] = useState(_habits);

  const handleClick = () => {
    setHabits('Eating')
  };

  return (
    <h1 onClick={handleClick}>{habits}</h1>
  )

};

export default App;
